    description: 'An element specifying a collection of images that are always processed
      together.

      Images can belong to more than one Dataset, and a Dataset may contain more than
      one Image.

      Images contain one or more DatasetRef elements to specify what datasets they
      belong to.

      Once a Dataset has been processed in any way, its collection of images cannot
      be altered.

      The ExperimenterRef and ExperimenterGroupRef elements specify the person and
      group this Dataset belongs to.

      Projects may contain one or more Datasets, and Datasets may belong to one or
      more Projects.

      This relationship is specified by listing DatasetRef elements within the Project
      element.

