      ''LongPass'', ''ShortPass'', ''BandPass'', ''MultiPass'',

      ''Dichroic'', ''NeutralDensity'', ''Tuneable'' or ''Other''.

      It can be associated with an optional FilterWheel - Note: this is not the same
      as a FilterSet

