      And information about how each of them was acquired is stored in the various
      optional *Ref elements.  Each Logical Channel is composed of one or more

      ChannelComponents.  For example, an entire spectrum in an FTIR experiment may
      be stored in a single Logical Channel with each discrete wavenumber of the spectrum

      constituting a ChannelComponent of the FTIR Logical Channel.  An RGB image where
      the Red, Green and Blue components do not reflect discrete probes but are

      instead the output of a color camera would be treated similarly - one Logical
      channel with three ChannelComponents in this case.

      The total number of ChannelComponents for a set of pixels must equal SizeC.

